  var roundedToTwoDecimals = Math.round(num * 100) / 100;
  // Check if the result after two-decimal rounding has a decimal part of .00 or .50+
  var integerPart = Math.floor(roundedToTwoDecimals);
  var decimalPart = roundedToTwoDecimals - integerPart;
  if (decimalPart === 0) {
    return integerPart; // No decimal part, keep as integer
  } else if (decimalPart >= 0.5) {
    return Math.round(roundedToTwoDecimals); // Round to the nearest integer
  } else {
    return roundedToTwoDecimals; // Otherwise, keep the two-decimal format
  }
}

